import React from 'react';
import Navigation from './components/Navigation/Navigation';
import Logo from './components/Logo/Logo';
import Background from './components/Background/Background';
import ImageLinkForm from './components/ImageLinkForm/ImageLinkForm';
import Rank from './components/Rank/Rank';
import Clarif from 'clarifai-nodejs-grpc';

import './App.css';
const stub = ClarifaiStub.json();
const metadata = new grpc.Metadata();
metadata.set("authorization", "525220c95f1740699a5c26e1421c5cfc");

stub.PostModelOutputs(
  {
      model_id: "aaa03c23b3724a16a56b629203edc62c",
      inputs: [{data: {image: {url: "https://www.desicomments.com/dc3/20/441082/441082.jpg"}}}]
  },
  metadata,
  (err, response) => {
      if (err) {
          console.log("Error: " + err);
          return;
      }

      if (response.status.code !== 10000) {
          console.log("Received failed status: " + response.status.description + "\n" + response.status.details);
          return;
      }

      for (const c of response.outputs[0].data.concepts) {
          console.log(c.name + ": " + c.value);
      }
  }
);

class App extends React.Component {
  constructor(){
    super();
    this.state = {
      input: '',
    }
  }

  onInputChange = (event) => {
    console.log(event.target.value);
  }
  onButtonSubmit = (event) => {
    event.preventDefault();
    console.log('click');
  }
  render(){
    return (
      <div className="App">

        <Navigation />
        <Logo />
        <Rank />
        <ImageLinkForm 
          onInputChange={this.onInputChange} 
          onButtonSubmit={this.onButtonSubmit}/>
        {/*


          <FaceRecognition />
          */
        }
        <Background className="background-animation" />
      </div>
    );
  }

}

export default App;
